import classes from './App.module.css';

function App() {
  return (



  <div className="container">

      <header>
          <nav>

          <h1> this is header </h1>

          </nav>
      </header>


          <section className="main">
              <h2>Main Content</h2>
          </section>

          <aside className="sidebar">
              <h3>Sidebar</h3>
          </aside>


      <footer>
          <h3>Footer</h3>

      </footer>

  </div>




  );
};

export default App;
